import React, { Fragment } from 'react'
import Sidebar from './Sidebar'

const Dashboard = () => {
    return (
        <Fragment>
            <div className="sidebar-dashboard">
                <Sidebar />
            </div>
        </Fragment>
    )
}

export default Dashboard
